import React, { Component } from 'react';

import './Menu.css';
const menu1 = "./imgs/menu1.jpg"
class MenuPage extends Component {
    render() {
        return(
        <div className="menu">
            <img src='{menu1}'/>
        </div>
        )
    }   
}

export default MenuPage;
